	add("dearth", "{\"term\":\"dearth\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"Icelandic\", \"Dutch\"], \"text\":\"First attested at least as early as the late 1400s, and appearing in Tyndale’s Pentateuch (1530) as well as the Coverdale Bible (1535). From Middle english (1100-1500) \u0027derþe\u0027 probably from Old english (ca. 450-1100) {{m|ang|*dīerþ}}, {{m|ang|*dīerþu}}, from Proto-germanic {{m|gem-pro|*diuriþō||costliness, preciousness, honour}}, corresponding to \u0027dear\u0027 + \u0027-th\u0027 Cognate with West frisian \u0027djoerte\u0027 (love, dearness, value, worth) Dutch \u0027duurte\u0027 (dearness; scarcity, dearth) Icelandic \u0027dýrð\u0027 (honour, glory)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A period or condition when food is rare and hence expensive; famine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Scarcity; a lack or short supply\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1608\u0027\u0027, William Shakespeare, \u0027King Lear\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I promise you, the effects he writes of succeed unhappily: as of unnaturalness between the child and the parent; death, \u0027\u0027dearth\u0027\u0027, dissolutions of ancient amities; divisions in state, menaces and maledictions against king and nobles; needless diffidences, banishment of friends, dissipation of cohorts, nuptial breaches, and I know not what\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Dearness; the quality of being rare or costly\", \"priority\":5}]}, \"synonyms\":{}}");

