	add("deattribution", "{\"term\":\"deattribution\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|deattribute|ion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Discontinuance of attributing a work of art or literature, etc. to a particular creator, especially in a case where a work is reassigned from a prominent creator to a lesser or unknown creator\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027 Sept. 30, Douglas C. McGill, \u0026quot;[http://www.nytimes.com/1986/09/30/arts/met-to-relabel-2-of-its-rembrandts.html Met to Relabel 2 of Its ‘Rembrandts’],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 25 Sep 2015)\u0026lt;/small\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Deattribution\u0027\u0027 of Rembrandt paintings has been going on among art historians for decades, constantly winnowing a corpus inflated by the 17th- and 18th-century practice of regarding many works simply in Rembrandt\u0027s style as \u0026quot;by the master.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, W. Stanley Taft Jr. and James W. Mayer, \u0027The Science of Paintings\u0027, ISBN 9780387217413, [https://books.google.ca/books?id\u003dnobhBwAAQBAJ\u0026amp;pg\u003dPA9\u0026amp;dq\u003d%22deattributions%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22deattributions%22\u0026amp;f\u003dfalse p. 9 (Google preview\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Attributions, \u0027\u0027deattributions\u0027\u0027, and reattributions are often more easily made after reviewing x-radiographs, infrared reflectograms, dendrochronological data, and pigment analyses\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027 April 24, \u0026quot;[http://www.independent.co.uk/arts-entertainment/art/great-works/a-dead-soldier-17th-century-anonymous-italian-1673117.html A Dead Soldier (17th century), Anonymous Italian],\u0026quot; \u0027Independent\u0027 (UK) \u0026lt;small\u0026gt;(retrieved 25 Sep 2015)\u0026lt;/small\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I]n the world of art, authors are always dying off. Works that were previously assigned to a known name, works that were among the most famous, find themselves stranded in anonymity. The process is called \u0027\u0027de-attribution\", \"priority\":8}]}, \"synonyms\":{}}");

	add("deazaflavin", "{\"term\":\"deazaflavin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|deaza|flavin|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flavin in which one nitrogen has been replaced by carbo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"7-nitro-5-\u0027\u0027deazaflavin\", \"priority\":2}]}, \"synonyms\":{}}");

